import Navbar from "../components/Navbar";
import { Link } from "react-router-dom";
import logo from "../image/logo.png";
// import "./AboutUs.css";

function AboutUs() {
  return (
    <div className="AboutUs h-screen">

      <Navbar/>
      <div>
        <h1>Qui sommes-nous?</h1>
        <h1>CIPA JESSOUGNON SA est une société<br />
          spécialisée dans les domaines de l’Entretien et<br />
          Nettoyage , désinfection et dératisation des<br />
          espaces publics et privés. Elle est dotée d’un<br />
          personnel qualifié, rompu à la tâche, avec des<br />
          équipements de dernière génération, une<br />
          solide expérience professionnelle de près de<br />
          20 ans et participe chaque année aux salons<br />
          d’hygiène en Europe. L’ensemble de nos<br />
          prestations respectent les principes de<br />
          nettoyage dans les Etablissement de grandes<br />
          affluences et de luxe. Elles allient la protection<br />
          à l’usage des techniques douces et procèdent<br />
          à la réalisation de tests en cas de doute, du<br />
          vertical à l’horizontal, du propre vers le sale à<br />
          reculons.</h1>
      </div>

    </div>
  );
}

export default AboutUs;
